import { ThemeFooter } from "./style";
const Footer = () => {
  return (
    <ThemeFooter w="100%" h="100px" bc="#68DAD8" j="space-around" a="center">
      <p className="">Email para contato:  lucasdeleonpaz@gmail.com</p>
      <p>© Copyright WebSchool 2022</p>
    </ThemeFooter>
  );
};

export default Footer;
